export async function getPlayerData(url) {
    try {
      // 1.  fetch  HTML
      const response = await fetch(url);
      if (!response.ok) {
        throw new Error(`HTTP : ${response.status}`);
      }
      const htmlString = await response.text();
  
      // 2.  DOMParser  HTML 
      //  <script> 
      const parser = new DOMParser();
      const doc = parser.parseFromString(htmlString, 'text/html');
  
      // 3.  "player_aaaa"  <script> 
      let targetScriptContent = null;
      const scripts = doc.querySelectorAll('script');
      for (const script of scripts) {
        // 
        if (script.textContent.includes('var player_aaaa')) {
          targetScriptContent = script.textContent;
          break; // 
        }
      }
  
      if (!targetScriptContent) {
        throw new Error(' player_aaaa ');
      }
  
      // ---  () ---

        // 1.  JSON  '{'
        const startIndex = targetScriptContent.indexOf('{');
        if (startIndex === -1) {
        throw new Error(' JSON  "{"');
        }

        // 2.  JSON  '}'
        const endIndex = targetScriptContent.lastIndexOf('}');
        if (endIndex === -1) {
        throw new Error(' JSON  "}"');
        }

        // 3.  '{'  '}'  JSON 
        const jsonString = targetScriptContent.substring(startIndex, endIndex + 1);

        // 4.  JSON.parse() 
        const player_aaaa = JSON.parse(jsonString);
  
      // 6. 
      return await decryptFromApiResponse(player_aaaa.url);
  
    } catch (error) {
      console.error(':', error);
      return null; //  null
    }
}


